import React from "react";
import { Container, List, Link } from "../style/header";
import { useNavigate } from "react-router-dom";

const Header = () => {
  const navigate = useNavigate();

  return (
    <div>
      <Container>
        <ul>
          <List>
            <li>
              <Link>Home</Link>
            </li>
            <li>
              <Link>About</Link>
            </li>
            <li>
              <Link>Contact Us</Link>
            </li>
            <li>
              <Link
                onClick={() => {
                  navigate("/login");
                }}
              >
                Login
              </Link>
            </li>
          </List>
        </ul>
      </Container>
    </div>
  );
};

export default Header;
